import React from 'react';
import styled from 'styled-components';

const Content = styled.main`
background-color: blue;
`
const ContentItems = styled.main`
font-size 20px;
`

function content() {
  return <Content>
    <ContentItems>First Item</ContentItems>
  </Content>;
}

export default content;
